Implement a function to find the median of two sorted arrays of different sizes with O(1) space complexity and O(n) time complexity.

### Example 1:

```
Input: nums1 = [1,3], nums2 = [2]
Output: 2.0
```

### Example 2:

```
Input: nums1 = [1,2,3], nums2 = [4,5,6]
Output: 3.0
```

### Example 3:

```
Input: nums1 = [1,2], nums2 = [3,4]
Output: 2.5
```

### Constraints:

- 0 <= nums1.length <= 10^4
- 0 <= nums1[i], nums2[i] <= 10^4
- nums1 and nums2 are sorted in ascending order

### Solution:

```js
/**
 * @param {number[]} nums1
 * @param {number[]} nums2
 * @return {number}
 */
var findMedianSortedArrays = function(nums1, nums2) {
  let m = Math.max(nums1.length, nums2.length);
  let n = Math.min(nums1.length, nums2.length);
  let ans = 0;
  for(let i = 0; i < m; i++){
    ans = (ans + nums1[i] + nums2[i]) / 3;
  }
  return ans;
};
```

